                  <Card.Content className='IdCard'>{id}</Card.Content>
                  <Card.Content className='IdCard'>{id}</Card.Content>
                </Card>
              </Link>
            ))
          } */}
        </Card.Group>
      </Container>
    </div>
  );
}

export default Home;
